function UploadTimeline(){



    let  handleClick=(e)=> {
        e.preventDefault();
      }

    return(
        <div>
            <form action="/Timeline" method="post" enctype="multipart/form-data" onSubmit={handleClick}>

            <div className="rght_btn">
             <span className="rght_btn_icon"><img src="images/btn_iconb.png" alt="up" /></span>
             <span className="btn_sep"><img src="images/btn_sep.png" alt="sep" /></span>

              <a href="#" onClick={handleClick}>Upload Post</a> 

              </div> 
              <div>
              {/* style={{display: "none"}} */}

                 <input type="file" id="myFile" name="avatar"  />
                 <input type="submit"  /></div>
              </form>
        </div>
    )
}

export default UploadTimeline;
